SET NAMES 'utf8mb4' COLLATE 'utf8mb4_unicode_ci';
SET CHARACTER SET utf8mb4;
CREATE DATABASE IF NOT EXISTS pc_clone_db
  CHARACTER SET utf8mb4
  COLLATE utf8mb4_unicode_ci;
USE pc_clone_db;
CREATE TABLE categories (id VARCHAR(255) PRIMARY KEY, name VARCHAR(255), parent_id VARCHAR(255), FOREIGN KEY (parent_id) REFERENCES categories(id));
CREATE TABLE products (   id VARCHAR(255) PRIMARY KEY,   name VARCHAR(255) NOT NULL,   href VARCHAR(255) NOT NULL,   price DECIMAL(10, 2) NOT NULL,   discount DECIMAL(4, 0),   seller VARCHAR(255) NOT NULL,   shadow_id VARCHAR(255),   offer_id VARCHAR(255),   brand VARCHAR(255) NOT NULL,   thumbnail VARCHAR(255) NOT NULL,   flags VARCHAR(255),   condition_status VARCHAR(255));
CREATE TABLE products_categories (product_id VARCHAR(255) NOT NULL, category_id VARCHAR(255) NOT NULL, FOREIGN KEY (product_id) REFERENCES products(id), FOREIGN KEY (category_id) REFERENCES categories(id), PRIMARY KEY (product_id, category_id));
